import React from 'react';
import './MovieComponent.css'

function Movie ( { id, title, image} ) {

  return (
    <div className='indivMovie' >
      <img src={`https://image.tmdb.org/t/p/w500${image}`} height='500px' width='400px' alt="Italian Trulli"/>
     <div>
     {title}
      </div> 
    </div> 
  );
}

export default Movie;
